import React from 'react';
import './App.css';
import './uikit.css'
import { BrowserRouter as Router, Route} from "react-router-dom";
import NavBar from './NavBar'
import Search from './Search'


function App() {
  return (
    <div
      className="App"
      background="https://images-assets.nasa.gov/image/GSFC_20171208_Archive_e002130/GSFC_20171208_Archive_e002130~thumb.jpg"
    >
      <Router>
        <NavBar />
        <Route path="/search" render={() => <Search />} />
      </Router>
    </div>
  );
}

export default App;
